  true,\n\t\"url\": null,\n\t\"notes\": \"Energy intensity data and documentation
  published by the U.S. DOE's office of Energy Efficiency and Renewable Energy (EERE).
  Energy intensity is defined as: amount of energy used in producing a given level
  of output or activity; expressed as energy per unit of output. Economy-wide energy
  intensity is also referred to as aggregate energy intensity. This is the energy
  intensity of the entire U.S. economy, and aggregates the intensity of the four major
  energy consuming end-use sectors (transportation, industrial, residential buildings
  and commercial buildings) and the electricity producing sector. Data is available
  for the period 1949 - 2004.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
